import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <h3>Contacto</h3>
      <p>Email: critianoronaldo@money.com</p>
      <p>Teléfono: 676832134</p>
      <div className="redes-sociales">
        <a href="#">Facebook</a>
        <a href="#">Twitter</a>
        <a href="#">Instagram</a>
      </div>
    </footer>
  );
}

export default Footer;
